import './scss/App.css';

function App() {
  return (
    <div className="App">
      <div className="app-container d-flex-center flex-column">
        <h1 className="logo-white">Gamic</h1>
        <div className="form-container">
          <form action="#" class="form" id="form" className="d-flex-center flex-column">
            <input type="text" placeholder="Game PIN" class="input" />
            <input type="text" placeholder="Nickname" class="input" />
            <button class="btn">Sign In</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
